package model.jsoninfo;

public class Water {
	private String station_name;
	private String pH_value;
	private String turbidity;
	private String residual_chlorine;
	public Water() {
		super();
		// TODO Auto-generated constructor stub
	}
	public String getStation_name() {
		return station_name;
	}
	public void setStation_name(String station_name) {
		this.station_name = station_name;
	}
	public String getpH_value() {
		return pH_value;
	}
	public void setpH_value(String pH_value) {
		this.pH_value = pH_value;
	}
	public String getTurbidity() {
		return turbidity;
	}
	public void setTurbidity(String turbidity) {
		this.turbidity = turbidity;
	}
	public String getResidual_chlorine() {
		return residual_chlorine;
	}
	public void setResidual_chlorine(String residual_chlorine) {
		this.residual_chlorine = residual_chlorine;
	}
	
	
	
}
